import {
  Box,
  Button,
  Card,
  Grid
} from "@mui/material";


const AddNewUser = () => {
  return (
    <Box pt={2} pb={4}>
      <Grid container spacing={3}>
        <Grid item md={8} xs={12}>
          <Card
            sx={{
              padding: 3,
            }}
          >
            <form >
              <Grid container spacing={3}>


                <Grid item xs={12}>
                  <Button type="submit" variant="contained">
                    Create User
                  </Button>
                </Grid>
              </Grid>
            </form>
          </Card>
        </Grid>
      </Grid>
    </Box>
  );
};

export default AddNewUser;
